import React, { Component } from "react";
import Slider from "react-slick";
import { Tab, Tabs, TabList, TabPanel } from "react-tabs";

// function CustomSliderNext(props) {
//   const { className, style, onClick } = props;
//   return (
//     <div
//       className={className}
//       style={{ ...style, display: "block", background: "red" }}
//       onClick={onClick}
//     />
//   );
// }

// function CustomSliderPrev(props) {
//   const { className, style, onClick } = props;
//   return (
//     <div
//       className={className}
//       style={{ ...style, display: "block", background: "green" }}
//       onClick={onClick}
//     />
//   );
// }

export default function HomeTop() {
  const slider = React.useRef(null);
  const settings = {
    dots: false,
    infinite: false,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    arrows: false,
  };

  return (
    <div>
      <h1 style={{ fontSize: "56px", color: "black" }}>
        Get measurable results
        <br /> from online marketing
      </h1>
      <p style={{ fontSize: "21px" }}>
        Do SEO, content marketing, competitor research,
        <br />
        PPC and social media marketing from just one platform.
      </p>
      <div>
        <input
          style={{ width: "600px", height: "60px" }}
          placeholder="Enter domain, keyword or URL"
          type="text"
        />
        <select style={{ width: "60px", height: "60px" }} name="US" id="">
          <option value="">US</option>
        </select>
        <button
          style={{
            height: "60px",
            width: "200px",
            color: "white",
            backgroundColor: "#ff622d",
            marginLeft: "50px",
            border: "none",
            borderRadius: "5px",
          }}
        >
          Start now
        </button>
        <h5 style={{ fontSize: "17px" }}>
          Trusted by the world’s leading brands
        </h5>
        <h1 style={{ fontSize: "45px" }}>See what's inside</h1>
        <div
          style={{
            backgroundColor: "white",
            border: "1px solid black",
            width: "60%",
            margin: "auto",
            height: "500px",
          }}
        ></div>
        <h1 style={{ fontSixe: "45px" }}>
          “Semrush is like a keyword research tool,
          <br /> Google Trends, Moz, Hootsuite and
          <br />
          SimilarWeb in one.”
        </h1>
        <img
          style={{
            borderRaidus: "50%",
            height: "120px",
          }}
          src="https://cdn.semrush.com/static/index/testimonials/Mario_Leon_Rojas@2x.6a8387fb699d.webp"
          alt="photo"
        />
        <p style={{ fontSize: "17px" }}>
          Performance Marketing Specialist, Banco del Sol
        </p>
        <p style={{ fontSize: "17px", color: "grey" }}>
          Source: Semrush G2 reviews
        </p>
      </div>
      <div>
        <h1 style={{ fontSize: "45px" }}>
          Award-winning tools trusted <br />
